1	Hotel SBH Royal Monica	Lanzarote	Lubiany przez Gości, znakomicie położony w pierwszej linii brzegowej – od oceanu oddziela go jedynie biegnąca wzdłuż plaży promenada. Ładnie zagospodarowany teren do opalania z jasnym piaskiem na wulkanicznych skałkach, typowych dla Lanzarote. Hotel otoczony jest zadbanym ogrodem z egzotyczną roslinnością. Do dyspozycji Gości są pokoje standardowe i komfortowe pokoje rodzinne z oddzielną sypialnią. Przyjemne baseny dla dorosłych i dla dzieci, korty tenisowe i animacje sprawiają, że jest to świetne miejsce dla rodzin z dziećmi, a także dla osób lubiących aktywne wakacje.	1.5	1	t	1	Hotel_SBH_Royal_Monica_1.png;Hotel_SBH_Royal_Monica_2.png;Hotel_SBH_Royal_Monica_3.png;Hotel_SBH_Royal_Monica_4.png;
